import React from 'react';
import './App.css'
import Header from './header';
import Home from './home';
import Coin from './coin';
import { BrowserRouter, Route } from 'react-router-dom';

export default function App() {

  return (
        <BrowserRouter>
          <div className="App">
            <Header />
          </div>
          <Route path="/" component={Home} />
          <Route path="/" component={Home} />
        </BrowserRouter>


  )
}
